BEGIN TRANSACTION;
CREATE TABLE crop (
	crop_no INTEGER NOT NULL, 
	crop_name VARCHAR(40) NOT NULL, 
	cropgroup_no INTEGER NOT NULL, 
	crop_model INTEGER NOT NULL, 
	PRIMARY KEY (crop_no)
);
CREATE TABLE crop_calendar (

	grid_no INTEGER NOT NULL, 

	crop_no INTEGER NOT NULL, 

	variety_no INTEGER NOT NULL, 

	year INTEGER NOT NULL, 

	start_date DATE NOT NULL, 

	crop_start_type VARCHAR(20) NOT NULL, 

	crop_start_date DATE NOT NULL, 

	crop_end_type VARCHAR(20) NOT NULL, 

	crop_end_date DATE NOT NULL, 

	max_duration INTEGER NOT NULL, 

	PRIMARY KEY (grid_no, crop_no, year)

);
CREATE TABLE crop_parameter_value (
	crop_no INTEGER NOT NULL, 
	parameter_code VARCHAR(20) NOT NULL, 
	parameter_xvalue NUMERIC(10, 5) NOT NULL, 
	parameter_yvalue NUMERIC(10, 5), 
	PRIMARY KEY (crop_no, parameter_code)
);
CREATE TABLE "ensemble_grid_weather" (
grid_no INTEGER NOT NULL, 
day DATE NOT NULL, 
member_id INTEGER NOT NULL, 
rainfall NUMERIC(10, 5) NOT NULL, 
PRIMARY KEY (grid_no, day, member_id)
);
CREATE TABLE grid (
	grid_no INTEGER NOT NULL, 
	latitude NUMERIC(10, 5) NOT NULL, 
	longitude NUMERIC(10, 5) NOT NULL, 
	altitude NUMERIC(10, 5) NOT NULL, 
	climate_barrier_no INTEGER NOT NULL, 
	distance_to_coast NUMERIC(10, 5) NOT NULL, 
	PRIMARY KEY (grid_no)
);
CREATE TABLE grid_weather (
	grid_no INTEGER NOT NULL, 
	day DATE NOT NULL, 
	maximum_temperature NUMERIC(10, 5) NOT NULL, 
	minimum_temperature NUMERIC(10, 5) NOT NULL, 
	vapour_pressure NUMERIC(10, 5) NOT NULL, 
	windspeed NUMERIC(10, 5) NOT NULL, 
	rainfall NUMERIC(10, 5) NOT NULL, 
	e0 NUMERIC(10, 5) NOT NULL, 
	es0 NUMERIC(10, 5) NOT NULL, 
	et0 NUMERIC(10, 5) NOT NULL, 
	calculated_radiation INTEGER NOT NULL, 
	snow_depth NUMERIC(10, 5), 
	PRIMARY KEY (grid_no, day)
);
CREATE TABLE "sim_results_summary" (
grid_no INTEGER NOT NULL, 
crop_no INTEGER NOT NULL, 
year INTEGER NOT NULL, 
simulation_mode VARCHAR(3) NOT NULL, 
member_id INTEGER NOT NULL, 
DVS NUMERIC(10, 5) , 
LAIMAX NUMERIC(10, 5) , 
TAGP NUMERIC(10, 5) , 
TWSO NUMERIC(10, 5) , 
TWLV NUMERIC(10, 5) , 
TWST NUMERIC(10, 5) , 
TWRT NUMERIC(10, 5) , 
CTRAT NUMERIC(10, 5) , 
RD NUMERIC(10, 5) , 
DOS DATE, 
DOE DATE, 
DOA DATE, 
DOM DATE, 
DOH DATE, 
DOV DATE,
PRIMARY KEY (grid_no, crop_no, year, simulation_mode, member_id)
);
CREATE TABLE "sim_results_timeseries" (
grid_no INTEGER NOT NULL, 
crop_no INTEGER NOT NULL, 
year INTEGER NOT NULL, 
day DATE NOT NULL, 
simulation_mode VARCHAR(3) NOT NULL, 
member_id INTEGER NOT NULL, 
DVS NUMERIC(10, 5) , 
LAI NUMERIC(10, 5) , 
TAGP NUMERIC(10, 5) , 
TWSO NUMERIC(10, 5) , 
TWLV NUMERIC(10, 5) , 
TWST NUMERIC(10, 5) , 
TWRT NUMERIC(10, 5) , 
TRA NUMERIC(10, 5) , 
RD NUMERIC(10, 5) , 
SM numeric(10,5), 
PRIMARY KEY (grid_no, crop_no, year, day, simulation_mode, member_id)
);
CREATE TABLE site (
	grid_no INTEGER NOT NULL, 
	year INTEGER NOT NULL, 
	ifunrn INTEGER NOT NULL, 
	max_surface_storage NUMERIC(10, 5) NOT NULL, 
	not_infiltrating_fraction NUMERIC(10, 5) NOT NULL, 
	initial_surface_storage NUMERIC(10, 5) NOT NULL, 
	inital_water_availability NUMERIC(10, 5) NOT NULL, smlim numeric(10,5), 
	PRIMARY KEY (grid_no, year)
);
CREATE TABLE soil_layers (

  soil_type_no INTEGER, 

  layer_no INTEGER, 

  thickness NUMERIC (10, 5), 

  soil_group_no INTEGER, 

  PRIMARY KEY (soil_type_no, layer_no)

  );
CREATE TABLE soil_physical_group (
	soil_group_no INTEGER NOT NULL, 
	parameter_code VARCHAR(30) NOT NULL, 
	parameter_xvalue NUMERIC(10, 5) NOT NULL, 
	parameter_yvalue NUMERIC(10, 5), 
	PRIMARY KEY (soil_group_no, parameter_code)
);
CREATE TABLE soil_type (

	grid_no INTEGER NOT NULL, 

	soil_type_no INTEGER NOT NULL, 

	PRIMARY KEY (grid_no)

);
CREATE TABLE tasklist (
	task_id INTEGER NOT NULL, 
	status VARCHAR(15) NOT NULL, 
	hostname VARCHAR(50), 
	grid_no INTEGER NOT NULL, 
	crop_no INTEGER NOT NULL, 
	year INTEGER NOT NULL, 
	sim_mode VARCHAR(5), 
	randomseed INTEGER NOT NULL, 
	PRIMARY KEY (task_id)
);
CREATE TABLE variety_parameter_value (
	crop_no INTEGER NOT NULL, 
	variety_no INTEGER NOT NULL, 
	parameter_code VARCHAR(20) NOT NULL, 
	parameter_xvalue NUMERIC(10, 5) NOT NULL, 
	parameter_yvalue NUMERIC(10, 5), 
	PRIMARY KEY (crop_no, variety_no, parameter_code)
);
CREATE TABLE "wofost_unittest_benchmarks" (
grid_no INTEGER NOT NULL, 
crop_no INTEGER NOT NULL, 
year INTEGER NOT NULL, 
day DATE NOT NULL, 
simulation_mode VARCHAR(3) NOT NULL, 
member_id INTEGER NOT NULL, 
DVS NUMERIC(10, 5) , 
LAI NUMERIC(10, 5) , 
TAGP NUMERIC(10, 5) , 
TWSO NUMERIC(10, 5) , 
TWLV NUMERIC(10, 5) , 
TWST NUMERIC(10, 5) , 
TWRT NUMERIC(10, 5) , 
SM NUMERIC(10, 5) ,
TRA NUMERIC(10, 5) , 
RD NUMERIC(10, 5) , 
PRIMARY KEY (grid_no, crop_no, year, day, simulation_mode, member_id)
);
COMMIT;
